// import React, { useContext, useMemo } from 'react'

// import AppBody from '../AppBody'
import React from 'react'
// import { Wrapper } from '../../components/swap/styleds'
// import { AutoColumn } from '../../components/Column'
import styled from 'styled-components'

const Div1 = styled.div`
  display: grid;
  grid-auto-rows: auto;
  row-gap: 24px;
  justify-items: center;
  max-width: 640px;
  width: 100%;
  background: ${({ theme }) => theme.bg1};
  box-shadow: 0px 0px 1px rgba(0, 0, 0, 0.01), 0px 4px 8px rgba(0, 0, 0, 0.04), 0px 16px 24px rgba(0, 0, 0, 0.04),
    0px 24px 32px rgba(0, 0, 0, 0.01);
  border-radius: 10px;
  padding: 1rem;
`

const Div11 = styled.div`
width: 100%;
    max-width: 720px;
  display: grid;
  grid-auto-rows: auto;
`
const Div111 = styled.div`
  display: grid;
    grid-template-columns: 1fr;
    gap: 15px 10px;
    width: 100%;
    justify-self: center;
`
const Div1111 = styled.div`
display: grid;
grid-auto-rows: auto;
border-radius: 12px;
width: 100%;
overflow: hidden;
position: relative;
opacity: 1;`

const Div11112 = styled.div`
display: flex;
-webkit-box-pack: justify;
justify-content: space-between;
flex-direction: column;
gap: 12px;
margin-bottom: 1rem;
margin-right: 1rem;
margin-left: 1rem;`

const Div111121 = styled.div`
box-sizing: border-box;
margin: 0px;
min-width: 0px;
width: 100%;
display: flex;
padding: 0px;
-webkit-box-align: center;
align-items: center;
-webkit-box-pack: justify;
justify-content: space-between;`

const Div1111211 = styled.div`
box-sizing: border-box;
margin: 0px;
min-width: 0px;
font-weight: 500;`

export default function Apply() {
  return (
    <>
      <Div1 >
        <Div11>
          <Div111>
            <Div1111>
              <Div11112>
                <Div111121>
                  <Div1111211> Bal</Div1111211>
                  <Div1111211> 10,000</Div1111211>
                </Div111121>
                <Div111121>
                  <Div1111211> Pedding</Div1111211>
                  <Div1111211> 8,888</Div1111211>
                </Div111121>
              </Div11112>
            </Div1111>
          </Div111>
        </Div11>
      </Div1>
    </>
  )
}
